new Vue({
    el: "#app",
    data: {
        content: {
            first: true,
            value: "",
        },
        onFocus: false,
        search: {
            index: 1,
            isShow: false,
            api: [
                {
                    name: "谷歌",
                    url: "https://www.google.com/search?q=",
                    sug:
                        "https://suggestqueries.google.com/complete/search?client=youtube&q=#content#&jsonp=window.flysky.sug",
                    icon:
                        "data:image/png;base64,",
                },
                {
                    name: "必应",
                    url: "https://www.bing.com/search?q=",
                    sug:
                        "https://api.bing.com/qsonhs.aspx?type=cb&q=#content#&cb=window.flysky.sug",
                    icon:
                        "data:image/png;base64,",
                },
                {
                    name: "百度",
                    url: "https://www.baidu.com/s?wd=",
                    sug:
                        "https://suggestion.baidu.com/su?wd=#content#&cb=window.flysky.sug",
                    icon:
                        "data:image/png;base64,",
                },
            ],
        },
        getSugdata: {
            getSugdelay: 0,
            value: [],
            valueLength: 10,
        },
        reg: [
            "^(http(s)?://){1}[\\s\\S]*$",
            "^((\\d{1,2}|1\\d\\d|2[0-4]\\d|25[0-5]).){3}(\\d{1,2}|1\\d\\d|2[0-4]\\d|25[0-5])(:\\d{1,5})?$",
        ],
    },
    watch: {
        "content.value"(newValue, oldValue) {
            this.search.isShow = false;
            clearTimeout(this.getSugdata.getSugdelay);
            if (newValue != "") {
                this.getSugdata.getSugdelay = setTimeout(() => {
                    this.getSug();
                }, 500);
            } else {
                this.getSugdata.value = [];
            }
        },
    },
    computed: {
        iconStyle() {
            return {
                "background-image":
                    "url(" + this.search.api[this.search.index].icon + ")",
            };
        },
        boxStyle() {
            let styleObj = {};
            if (this.content.value != "") {
                this.content.first = false;
                styleObj["animation"] = "showColor 0.3s linear forwards";
            } else if (!this.content.first) {
                styleObj["animation"] = "-showColor 0.3s linear forwards";
            }
            if (this.onFocus) {
                styleObj["box-shadow"] = "0px 0px 5px #BDBDBD";
            }
            return styleObj;
        },
    },
    created() {
        let localindex = localStorage.getItem("index");
        if (localindex != null) {
            this.search.index = localindex;
        }
    },
    methods: {
        getFocus() {
            this.onFocus = true;
        },
        loseFocus() {
            this.onFocus = false;
        },
        goSearch(res) {
            let reg0 = new RegExp(this.reg[0]);
            let reg1 = new RegExp(this.reg[1]);
            if (res != undefined && res != "") {
                if (reg0.test(res)) {
                    window.location.href = res;
                }
                if (reg1.test(res)) {
                    window.location.href = "http://" + res;
                } else {
                    window.location.href =
                        this.search.api[this.search.index].url + res;
                }
                this.content.value = "";
            }
        },
        keyDown(event) {
            if (event.keyCode == 13) {
                this.goSearch(this.content.value);
            }
        },
        showSearch() {
            this.getSugdata.value = [];
            this.search.isShow = !this.search.isShow;
            setTimeout(() => {
                this.search.isShow = false;
                this.getSug();
            }, 3000);
        },
        setIndex(res) {
            this.search.index = res;
            localStorage.setItem("index", res);
        },
        getSug() {
            let sugurl = this.search.api[this.search.index].sug;
            sugurl = sugurl.replace("#content#", this.content.value);
            const that = this;
            window.flysky = {
                sug(data) {
                    that.getSugdata.value = [];
                    if (that.search.index == 0) {
                        data[1].forEach((res) => {
                            that.getSugdata.value.push(res[0]);
                        });
                    }
                    if (that.search.index == 1) {
                        data.AS.Results[0].Suggests.forEach((res) => {
                            that.getSugdata.value.push(res.Txt);
                        });
                    }
                    if (that.search.index == 2) {
                        data.s.forEach((res) => {
                            that.getSugdata.value.push(res);
                        });
                    }
                    if (
                        that.getSugdata.value.length >
                        that.getSugdata.valueLength
                    ) {
                        that.getSugdata.value.length =
                            that.getSugdata.valueLength;
                    }
                },
            };
            var script = document.createElement("script");
            script.src = sugurl;
            document.getElementsByTagName("head")[0].appendChild(script);
        },
    },
});
